import * as React from 'react';
import { View, Text, Image,TouchableOpacity, StyleSheet } from 'react-native';


function ListUserChatScreen(props) {
    return (
      <View 
        style={ styles.container}>
        <TouchableOpacity style={{flexDirection: 'row', margin: 10,}} onPress={() =>props.navigation.navigate('Comunication')}>
          <Image
            style={styles.img}
            source= {{uri: 'https://akinavn.vn/wp-content/uploads/2020/07/hinh-anh-buon-khoc-.jpg'}}
          />
          <Text style={styles.textName}>Name</Text>
        </TouchableOpacity>
      </View>
    );
}
export {ListUserChatScreen};

var styles = StyleSheet.create({
  container: {
    margin: 10,
    backgroundColor: 'white',
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  img: {
    width: 80, 
    height: 80, 
    borderRadius: 50
  },
  textName: {
    fontSize: 18, 
    fontWeight: 'bold', 
    marginLeft: 20}
})
